import React from 'react';
import '../styles/RomanticCard.css';

const RomanticCard = ({ onNext }) => {
  const handleYesClick = () => {
    onNext();
  };

  return (
    <div className="romantic-section section">
      <div className="card">
        <h2>Okay, I'm done being annoying. Will you be my Belated Valentine?</h2>
        <button id="finalYesButton" className="glow-button" onClick={handleYesClick}>
          Yes
        </button>
      </div>
    </div>
  );
};

export default RomanticCard;
